import pdfMake from "pdfmake/build/pdfmake";
import * as pdfFonts from "pdfmake/build/vfs_fonts";

// Fallback: Assign vfs to the window object
if (!(window as any).pdfMake) {
  (window as any).pdfMake = pdfMake;
}

// Base64 string for VazirMatn (paste the content from the generated Base64 file here)
const vazirMatnRegularBase64 =
  "";

const vazirMatnBoldBase64 =
  "";
// Add the fonts to the virtual file system
pdfMake.vfs = {
  ...pdfMake.vfs, // Retain default fonts
  "VazirMatn-Regular.ttf": vazirMatnRegularBase64,
  "VazirMatn-Bold.ttf": vazirMatnBoldBase64,
};

// Define the VazirMatn font family
pdfMake.fonts = {
  VazirMatn: {
    normal: "VazirMatn-Regular.ttf", // Regular font
    bold: "VazirMatn-Bold.ttf", // Bold font
    italics: "VazirMatn-Regular.ttf", // Fallback to regular
    bolditalics: "VazirMatn-Bold.ttf", // Fallback to bold
  },
};

// Fallback for environments requiring manual window assignment
if (!(window as any).pdfMake) {
  (window as any).pdfMake = pdfMake;
}
(window as any).pdfMake.vfs = pdfMake.vfs;

// Export configured pdfMake
export default pdfMake;
